• fungsi push otomatis nu bisa nyorong dewan panel rengse ti worktable jeung ngumpulkeun dusts salila gawe di waktu nu sami. Ku cara kieu, eta pisan gampang pikeun operator pikeun ngabongkar momotanana dewan panel na dewan dahar anyar harese kuat sedot on worktable nu;
