 Max. Ngagawekeun Speed: 45000mm / mnt;
• Power Spindle: 9KW ATC cooling hawa spindle;
• Spindle Speed: 0-24000RPM;
• Girang motor: Japan YASKAWA servo motor jeung drivers;
