aplikasi:
Rupa industri jati kai: plat Wave, pola rupa, jati antik, panto kai, layar, karajinan sash, Gerbang komposit, panto lomari, lawang interior, headboards jeung saterusna;

1, Ngagunakeun rupa-rupa platform dagang bebas, palaksanaan operasi bisnis parusahaan, palaksanaan peraturan dagang, ngamekarkeun customer;
2 ,Kumpulkeun inpormasi pasar luar negeri sareng inpormasi industri, milarian palanggan poténsial, sareng inpormasi palanggan target;
3 , Mandiri tanggung jawab ngahubungan konsumén, persiapan laporan, partisipasi dina hungkul bisnis , Kontrak, ngajaga klien;
4 , Ilubiung dina paméran di imah jeung di mancanagara, sarta ngamekarkeun konsumén anyar ngaliwatan sagala rupa saluran, rék dilegakeun volume bisnis;
5 ,Ngalaporkeun usaha anu aya hubunganana sareng hal-hal sanés anu aya hubunganana sareng tanggung jawab atasanna;
6. Pikiran gancang, béntés dina basa Inggris, kalayan kaahlian komunikasi sareng negosiasi anu kuat.
1 ,Atikan térsiér sareng luhur, perdagangan internasional sareng prioritas utama Inggris;
2 ,Kamampuh basa Inggris, komunikasi lisan jeung tulisan bisa lancar, bakal méré prioritas kana basa leutik;
3, Leuwih ti dua taun pangalaman gawé relevan, akrab jeung kaahlian dagang impor jeung ékspor;
4 ,Strong bisnis komunikasi jeung badami kaahlian, aya paméran, ngembangkeun bebas konsumén;
